import Button from "../UI/Button/Button";
import JobAnalyticsListPage from "./JobAnalyticsList";
import classes from "./jobanalytics.module.css";

const DUMMY_ANALYTICS = [
  {
    id: "i1",
    icon: "- ",
    label: "Applicants",
    number: 400,
  },
  {
    id: "i2",
    icon: "- ",
    label: "Matches",
    number: 100,
  },
  {
    id: "i3",
    icon: "- ",
    label: "Messages",
    number: 147,
  },
  {
    id: "i4",
    icon: "- ",
    label: "Views",
    number: 800,
  },
];

function JobAnalyticsPage() {
  return (
    <div>
      <Button size="sm" theme="light">
        Delete Job
      </Button>
      <Button size="sm" theme="dark">
        Edit Job
      </Button>

      <ul className={classes.job_analytics_list_container}>
        {DUMMY_ANALYTICS.map((list) => (
          <JobAnalyticsListPage
            key={list.id}
            icon={list.icon}
            label={list.label}
            number={list.number}
          />
        ))}
      </ul>
    </div>
  );
}

export default JobAnalyticsPage;
